import React from 'react';
import Registration from './Registration';
import Login from './Login';

const SignIn = () => {
    return (
        <div className="bg-image login-bg">

            <div className='row'>
                <div className='col-3'>
                    <Registration></Registration>
                </div>
                <div className='col'>
                    <Login></Login>
                </div>
            </div>

        </div>
    );
};

export default SignIn;
